import React from "react";

const Order = ({ orderObject }) => {
  return (
    <React.Fragment>
      <div className="accordion-section">
        <button className="accordion-title" onClick={toggleActive}>
          <p>{orderObject.title}</p>
          <span
            className={active ? "accordion-icon rotate" : "accordion-icon"}
          />
        </button>
      </div>
    </React.Fragment>
  );
};

export default Order;
